import Cards from './components/Cards';
import Header from './components/Header';
import { concepts } from './DummyData';

function App() {
  return (
    <div>
      <Header />
      <ul id="concepts">
        <Cards cards={concepts}/>
      </ul>
    </div>
  );
}

export default App;
